package CoreDataTypes;

public class TestRelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10,b=20,c=10;
		System.out.println("print a>b" +(a>b));//false
		System.out.println("print a<b" +(a<b));//true
		System.out.println("print a<=b" +(a<=b));//true
		System.out.println("print a>=c" +(a>=c));//true
		System.out.println("print a==c" +(a==c));//true
		System.out.println("print a!=b" +(a!=b));//true
		System.out.println("print a!=c" +(a!=c));//false

	}

}
